measurements.description:
Fourteen flowers on two up to 35-cm inflorescences;

sepals and petals round, flat, slight fenestrations between dorsal sepal and petals, white overlaid dark purple
spots coalescing at distal edges; lip white, side lobes overlaid light purple, midlobe overlaid dark purple, throat dark purple stripes;
column white blushed pink centrally, anther cap yellow;

	substance firm; texture crystalline.
